import styles from "./ViewOrder.module.css";
import Modal from "./../Modal/Modal";

const ViewOrder = (props) => {
  const orderData = props.orderData;
  return (
    <Modal>
      <div>{orderData.id}</div>
    </Modal>
  );
};

export default ViewOrder;
